@title Math library for computing sqrt prices from Units and vice versa
 @notice Computes sqrt price for Units of size 1.0001, i.e. sqrt(1.0001^Unit) as fixed point Q64.96 numbers. Supports
 prices between 2**-128 and 2**128

@notice Calculates sqrt(1.0001^Unit) * 2^96
 @dev Throws if |Unit| > max Unit
 @param Unit The input Unit for the above formula
 @return sqrtPriceX96 A Fixed point Q64.96 number representing the sqrt of the ratio of the two assets (token1/token0)
 at the given Unit

@notice Calculates the greatest Unit value such that getRatioAtUnit(Unit) <= ratio
 @dev Throws in case sqrtPriceX96 < MIN_SQRT_RATIO, as MIN_SQRT_RATIO is the lowest value getRatioAtUnit may
 ever return.
 @param sqrtPriceX96 The sqrt ratio for which to compute the Unit as a Q64.96
 @return Unit The greatest Unit for which the ratio is less than or equal to the input ratio
